/* Generated File Run.js in Project application1 */	function close_application1(){	Minimizer.close("application1");}	function minimize_application1(){	Minimizer.minimize("application1");}	function maximize_application1(){	Minimizer.maximize("application1");}function open_application1(){}/* Initialize application */			function init_application1(){	$("#body-application1").keypress(function(event) {	}).mouseover(function(){	    $("#application1-container").draggable({disabled:true});    }).mouseout(function(){        $("#application1-container").draggable({disabled:false});    });		$("#application1-container").mousedown(function(){		Focus.set("application1");		setMenu_application1();			fixSizeapplication1Speed = 0;	})	.mouseup(function(){		fixSizeapplication1Speed = 300;	});		/* Make application resizable */	Resizable.set("application1");		$("#exit-application1").mousedown(function(){		close_application1();		$("#body-application1").val("");	});	$("#maximize-application1").mousedown(function(){		maximize_application1()	});		$("#minimize-application1").mousedown(function(){		minimize_application1()	});			fixSize_application1();}/* Fix size application */var fixSizeapplication1Speed = 300;function fixSize_application1(){	setTimeout(function(){		if(LoadAppsID["application1"].onFocus){			height = $("#application1-container").height();			width = $("#application1-container").width();			$("#body-application1").css({"height" : height-45, "width" : width-5});		}		fixSize_application1();	},fixSizeapplication1Speed);}/* Set application menu */function setMenu_application1(){	proIdApps = "application1";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>Aplikasi 1</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_application1(proIdApps)>Minimize</li>"+			"<li onclick=maximize_application1(proIdApps)>Maximize</li>"+			"<li onclick=close_application1(proIdApps)>Quit Aplikasi 1</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_application1(){	$.post("system/applications/application1/layout/application1.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_application1,100);		fixSize_application1();		applicationOpened++;	});	}/* Running application */function run_application1(dir, fileName){}